function TechStack() {
    return(
        <>
            <ul style={{
                listStyle: "none",
                textAlign: "center",
                paddingLeft: "10px",
                paddingRight: "10px",
                fontWeight: "bold",
                backgroundColor: "beige",
            }}>
                <li>HTML</li>
                <li>CSS</li>
                <li>JAVASCRIPT</li>
                <li>REACT JS</li>
            </ul>
        </>

    )
}

export default TechStack;
